import React from 'react'
import './Header.css'

function Header() {
  return (
    <div className='header'>
        <div className="header-content">



            <p>
                At Dawit's, we specialize in crafting mouthwatering dishes with the finest ingredients, delivered straight to your door. 
                Whether you're craving a hearty meal or a light snack, we offer an array of delicious options to suit every taste. 
                Enjoy the convenience of freshly prepared food, made with love, and delivered to your home every day!
            </p>
            {/* Link to navigate to the "Explore Menu" section */}
            <button> <a href="#explore-menu">View Menu</a></button>
        </div>
    </div>
  )
}

export default Header;
